Today is Earth Day, so no better time to share an important issue going on in the Maldives on the island Fuvahmulah, a significant island for many critically endangered and threatened marine species in the region. On such a tiny island, they don’t have much infrastructure or resources to handle waste, especially plastic which keeps building up.

Water bottles account for about 40% of the waste on the island, and we are happy to share a sponsorship program you can be a part of to help. A water filter is $325 USD, and if one is sponsored in every household (about 1,000 homes), this will allow is island to transition to refilling glass bottles and prevent millions of plastic water bottles from going into the ocean.

Thank you so much for considering donating to this small community cause which will help the locals both above and below water. This beautiful island is surrounded by incredible but sadly vulnerable marine life year round. 
Mahalo to @cara.strober.driggers and #NortaLlana and @Oceanculturelife for being among the most recent to sponsor water filters for the people of Fuvamulah, as well as our other sponsors listed below, please follow them.  Donate via the link in bio at @savethseaturtlesinternational which is 100% tax deductible for the US and other select countries.

